import React, { Component } from "react";

export default class Card extends Component {
  render() {
    return (
      <div>
        <div className="card">
          <p
            style={{ paddingLeft: "5%", paddingBottom: "0", marginBottom: "0" }}
          >
            {this.props.title}
          </p>
          <hr className="horizontal_line" />
          <div class="container">
            <p>Architect & Engineer</p>
          </div>
        </div>
      </div>
    );
  }
}
